import React,{Component} from './react';

//element  based react component
const Post= (props)=>{
    return(
        <div className="container">
            <div className="row">
                <div className="col-md-12 jumbotron text-center">
                    <h3>{props.title}</h3>
                </div>
            </div>

        </div>
    )
}

export default Post;
